import React, {Component} from 'react';


class App extends Component{

  constructor(props){
    super(props);
    this.state = {
      cartList: []
    }
  }

  componentDidMount() {
     fetch("http://jsonplaceholder.typicode.com/todos").then(data => data.json()).then(data =>this.setState({cartList: data})).catch(console.log);
  }
  render() {
    return (
      <div className = "container">
        <div className = "col-xs-12">
          <h1>Welcome to Shop-R-US</h1>
            {this.state.cartList.map(e =>
              <div>
                {e.title} {e.id} {e.userId}
               </div> 

              )}
        </div>
      </div>
    );
  }

}

export default App;
